import axios from "axios";

import {key} from '../../key';

const url = 'https://api.rasp.yandex.net/v3.0/stations_list/';

const api = {
  async getSchedules(): Promise<any> {
    // @ts-ignore
    const { data } = await axios.get(`${url}?lang=ru_RU&format=json&apikey=${key}`, { crossdomain: true });
    return data;
  }
}

export default api;
